use PrestamoLibros
go

-- drop table editoriales;

create table editoriales
(
	id int identity,
	codigo nvarchar(10),
	nombre nvarchar(150),
	fecha_registro datetime default getdate(),
	estado int default 1,
	
	constraint pk_editoriales primary key (id)
)
go

-- drop table libros;
create table libros
(
	id int identity,
	isbn nvarchar(100),
	titulo nvarchar(300),
	autores nvarchar(300),
	edicion nvarchar(100),
	anio int,
	id_editorial int not null,
	fecha_registro datetime default getdate(),
	estado int default 1,
	
	constraint pk_libros primary key (id), 
	constraint fk_libros_id_editorial foreign key (id_editorial) references editoriales(id)
)
go


-- drop table libros;
create table solicitantes
(
	id int identity,
	nombre_completo nvarchar(200),
	documento_identidad nvarchar(20),
	email nvarchar(100),
	telefono nvarchar(20),
	fecha_registro datetime default getdate(),
	estado int default 1,
	
	constraint pk_solicitantes primary key (id), 
)
go

-- drop table prestamos_detalles;
-- drop table prestamos;

create table prestamos
(
	id int identity,
	fecha_prestamo datetime default getdate(),
	fecha_devolucion datetime,
	estado_prestamo int default 0, -- {0=prestamo, 1=devuelto, 2=devuelto_parcialmente}
	id_solicitante int not null,
	fecha_registro datetime default getdate(),
	estado int default 1,
	
	constraint pk_prestamos primary key (id),
	constraint fk_prestamos_id_solicitante foreign key (id_solicitante) references solicitantes(id)
)
go

create table prestamos_detalles
(
	id_prestamo int not null,
	id_libro int not null,
	devuelto int default 0,
	mora decimal(12,2) default 0,
	fecha_registro datetime default getdate(),
	estado int default 1,
	
	constraint pk_prestamos_detalles primary key (id_prestamo, id_libro),
	constraint fk_prestamos_detalles_id_prestamo foreign key (id_prestamo) references prestamos(id),
	constraint fk_prestamos_detalles_id_libro foreign key (id_libro) references libros(id)
)
go


